import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import dummyPictures from '../../../dummyDate';

function Gallery() {
    console.log('dummyPictures : ', dummyPictures);
    const [temp, setTemp] = useState(false);
    const [forRendering, setForRendering] = useState();

    // 애초에 4개씩 받아서 뿌릴 것

    useEffect(() => {
        let _pictures = [];
        for(let i = 0; i < 3; i++){
            _pictures.push(dummyPictures.pictures[i]);
        }
        setForRendering(<div 
            style={{ display: 'flex'}}>{_pictures.map((el)=>{
            return <p key={el.id}><img src={el} alt="picture"></img></p>
        })}</div>)
    }, [temp])
    return (
        <div style={{ textAlign: 'center' }}>
            <div>
                {}
            </div>
        </div>
    )
}

export default Gallery

const Img = styled.img`
    width: 50vw;
`

